script: |
  super -f text -I q4327.spq | sort > q4327.out

inputs:
  - name: q4327.spq
    data: |
      SELECT ALL 57 AS col0 FROM tab1 (FORMAT parquet) WHERE - col1 * - + col0 NOT BETWEEN NULL AND ( - + col1 * - col0 - - 30 + - - CAST ( NULL AS INTEGER ) );
  - name: tab1

outputs:
  - name: q4327.out
    data: |
